"use strict";(self.webpackChunkreubenliengaard_github_io=self.webpackChunkreubenliengaard_github_io||[]).push([[8636],{2539:e=>{e.exports=JSON.parse('{"title":"Linux","description":"Linux is a family of open-source Unix-like operating systems based on the Linux kernel, an operating system kernel first released on September 17, 1991, by Linus Torvalds. Linux is typically packaged as a Linux distribution, which includes the kernel and supporting system software and libraries, many of which are provided by the GNU Project. Many Linux distributions use the word Linux in their name, but the Free Software Foundation uses the name GNU/Linux to emphasize the importance of GNU software, causing some controversy.","slug":"/category/linux","permalink":"/docs/category/linux","navigation":{"previous":{"title":"Tensegrity","permalink":"/docs/parametric/parametric-definitions/tensegrity"},"next":{"title":"Process","permalink":"/docs/category/process"}}}')}}]);